-- Top services by keywords count
SELECT
  fs.service_code,
  fs.name_es,
  COUNT(*) as keywords_count
FROM service_keywords sk
JOIN fiscal_services fs ON sk.fiscal_service_id = fs.id
GROUP BY fs.service_code, fs.name_es
ORDER BY keywords_count DESC
LIMIT 10;

-- ============================================
-- USAGE: Recherche par keyword
-- ============================================

-- Recherche simple
SELECT DISTINCT
  fs.service_code,
  fs.name_es,
  sk.keyword,
  sk.language_code
FROM service_keywords sk
JOIN fiscal_services fs ON sk.fiscal_service_id = fs.id
WHERE sk.keyword ILIKE '%legal%'
ORDER BY fs.service_code;

-- Recherche full-text avec ranking
SELECT
  fs.service_code,
  fs.name_es,
  COUNT(*) as matches,
  array_agg(DISTINCT sk.keyword) as matched_keywords
FROM service_keywords sk
JOIN fiscal_services fs ON sk.fiscal_service_id = fs.id
WHERE sk.language_code = 'es'
  AND sk.keyword ILIKE '%document%'
GROUP BY fs.service_code, fs.name_es
ORDER BY matches DESC;
